DROP TABLE IF EXISTS Student CASCADE;
CREATE TABLE Student
(
	Id SERIAL PRIMARY KEY,
	Name Char(50) NOT NULL,
	SurName Char(50) NOT NULL
);

DROP TABLE IF EXISTS Subject CASCADE;
CREATE TABLE Subject
(
	Id SERIAL PRIMARY KEY,
	Name Char(150) NOT NULL
);

DROP TABLE IF EXISTS Teacher CASCADE;
CREATE TABLE Teacher
(
	Id SERIAL PRIMARY KEY,
	Name Char(50) NOT NULL,
	SurName Char(50) NOT NULL
);

DROP TABLE IF EXISTS Excercise CASCADE;
CREATE TABLE Excercise
(
	Id SERIAL PRIMARY KEY,
	IdSubject INT,
	StartTime INT,
	Length INT
);

DROP TABLE IF EXISTS Student_Subject CASCADE;
CREATE TABLE Student_Subject
(
	Id SERIAL,
	IdStudent INT,
	IdSubject INT
);

DROP TABLE IF EXISTS Student_Excercise CASCADE;
CREATE TABLE Student_Excercise
(
	Id SERIAL,
	IdStudent INT,
	IdExcercise INT
);

DROP TABLE IF EXISTS Teacher_Subject CASCADE;
CREATE TABLE Teacher_Subject
(
	Id SERIAL,
	IdTeacher INT,
	IdSubject INT,
	MainTeacher BOOLEAN NOT NULL DEFAULT FALSE
);


ALTER TABLE Student_Subject ADD FOREIGN KEY (IdStudent) REFERENCES Student(Id) on delete cascade;
ALTER TABLE Student_Subject ADD FOREIGN KEY (IdSubject) REFERENCES Subject(Id) on delete cascade; 

ALTER TABLE Teacher_Subject ADD FOREIGN KEY (IdTeacher) REFERENCES Teacher(Id) on delete cascade; 
ALTER TABLE Teacher_Subject ADD FOREIGN KEY (IdSubject) REFERENCES Subject(Id) on delete cascade;  

ALTER TABLE Student_Excercise ADD FOREIGN KEY (IdStudent) REFERENCES Student(Id) on delete cascade; 
ALTER TABLE Student_Excercise ADD FOREIGN KEY (IdExcercise) REFERENCES Excercise(Id) on delete cascade; 

ALTER TABLE Excercise ADD FOREIGN KEY (IdSubject) REFERENCES Subject(Id) on delete cascade;  


